import KaKao from "./components/Map";

import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Main } from "./pages/Main";

function App() {
  return (
    <div className="App">
      {/* <KaKao></KaKao> */}
      <BrowserRouter>
        <Route>
          <Route exact path="/" element={<Main />} />
        </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
